export const changeHandler = (event, form, setForm) => {
  const property = event.target.name;
  const value = event.target.value;

  setForm({ ...form, [setForm]: value });
};

export const weightHandler = (event, form, setForm) => {
  const property = event.target.name;
  const value = event.target.value;
};

export const heightHandler = (event, form, setForm) => {};

export const handleSubmit = (event) => {
  event.preventDefault(); //! Asi no recarga la pag cuando tocamos enter
};
